import { Link } from 'react-router-dom';

function Header() {
	return (
		<nav>
			<Link to="/">Accueil</Link>
			<Link to="/survey/42">Questionnaire</Link>
			<Link to="/Freelances">Freelances</Link>
		</nav>
	);
}

export default Header;
